measurements.description:
An estimated 100 non-resupinate flowers and 50 buds on an unstaked upright
 inflorescence 55 cm in length; grown in bark in an 8-cm plastic pot, 
 plant 8 cm tall, 23 cm wide, five leaves in rosette, dark green leaves up to 13 cm in length,
 wide longitudinal silver stripes, margins undulate;
 sepals and petals white; lip white spotted dark green;
 substance firm; texture matte; recognized for rarity and foliage markings.
